import React from 'react';

import { Col, Panel } from 'react-bootstrap';
import {CryptoCard} from 'react-ui-cards'

const card = (props) => {
    return (
        <Col xs={12} sm={3}>
            <Panel bsStyle="primary">
                <Panel.Heading >
                    <Panel.Title componentClass="h3">
                        {props.title}
                    </Panel.Title>
                </Panel.Heading>
                <Panel.Body>
                <CryptoCard
          currencyName={props.name}
          currencyPrice={props.price}
          icon={<img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/2000px-Bitcoin.svg.png"/>}
          currencyShortName='BTC'
          trend='(8.54%) $563.47'
          trendDirection={1}
          chartData={[9200, 5720, 8100, 6734, 7054, 7832, 6421, 7383, 8697, 8850]}
        />
                </Panel.Body>
            </Panel>
        </Col>
    )
};

export default card;
